// SPDX-License-Identifier: MIT
pragma solidity 0.8.3;

import "./lib/Ownable.sol";
import "./lib/SafeMath.sol";
import "./interface/IERC20.sol";
import "./interface/ICompound.sol";
import "./interface/IPool.sol";

contract Pool is Ownable, IPool {
    using SafeMath for uint256;

    // user details
    struct User {
        address user;
        bool claimed;
    }
    User[] public usersList;
    mapping (address => uint256) public usersIndex;

    // pool details
    uint256 public startDate;
    uint256 public participationEndDate;
    uint256 public endDate;
    uint256 public poolCost;

    //winner details
    address public rewardedUser;
    uint256 public winnersAmount;

    IERC20 public poolToken;
    ICompound public tokenCompound;

    bool init;

    function initialize(address token, address compound, uint256 _startDate, uint256 _participationEndDate, uint256 _endDate, uint256 _poolCost) override external {
        require(!init, "AlreadyInitialized");
        require(_endDate > _participationEndDate && _participationEndDate >_startDate, "InvalidDate");
        require(_poolCost != 0, "InvalidCost");

        poolToken = IERC20(token);
        tokenCompound = ICompound(compound);

        Ownable.setOwner(msg.sender);

        if (compound != address(0)) {
            poolToken.approve(compound, 115792089237316195423570985008687907853269984665640564039457584007913129639935);
        }

        startDate = _startDate;
        participationEndDate = _participationEndDate;
        endDate = _endDate;
        poolCost = _poolCost;
        init = true;
    }

    function play(address _user) onlyOwner override external {
        require(block.timestamp >= startDate, "NotStarted");
        require(block.timestamp <= participationEndDate, "participationDateEnded");
        require(usersIndex[_user] == 0, "AlreadyUser");

        poolToken.transferFrom(_user, address(this), poolCost);

        if (address(tokenCompound) != address(0)) {
            tokenCompound.mint(poolCost);
        }

        usersList.push(User(_user, false));
        usersIndex[_user] = usersList.length;
    }

    function setWinner(uint256 _number) onlyOwner override external {
        require(block.timestamp > endDate, "NotEnded");
        require(rewardedUser == address(0), "WinnerAlreadySelected");
        uint256 _usersLength = usersList.length;
        require(_number < _usersLength, "InvalidNumber");

        if (address(tokenCompound) != address(0)) {
            require(0 == tokenCompound.redeem(tokenCompound.balanceOf(address(this))), "CompoundError");
        }

        User memory _user = usersList[_number];
        rewardedUser = _user.user;
        winnersAmount = (poolToken.balanceOf(address(this))).sub(poolCost.mul(_usersLength));

    }

    function claim(address _user) onlyOwner override external {
        require(rewardedUser != address(0), "WinnerNotChosen");

        uint256 _id = usersIndex[_user];
        require(_id != 0, "NotUser");
        _id = _id - 1;

        User memory _member = usersList[_id];
        require(!_member.claimed, "AlreadyClaimed");

        if (_user == rewardedUser) {
            poolToken.transfer(_user, poolCost.add(winnersAmount));
        } else {
            poolToken.transfer(_user, poolCost);
        }
        _member.claimed = true;
        usersList[_id] = _member;
    }

    function getUsersListLength() override external view returns(uint256) {
        return usersList.length;
    }
}
